// App.js
import React from "react";
import MagicLogin from "./MagicLogin";

function App() {
  return (
    <div style={{ padding: "2rem", fontFamily: "Arial, sans-serif" }}>
      <h1>Migrant Identity Login</h1>
      <MagicLogin />
    </div>
  );
}

export default App;
